import React from 'react';
import './HeroSection.css';

import '../App.css';

function AboutUs() {
    return (
        <div className='hero-container'>
        <video src='./videos/CyberTEchDemo.mp4' autoPlay loop muted />

        <div className='instagram-video'>
        <iframe
          title='Instagram Video'
          src='https://www.instagram.com/reel/CrwZ4nfLNgd/?utm_source=ig_web_button_share_sheet&igshid=MmJiY2I4NDBkZg=='
          width='100%'
          height='auto'
          frameborder='0'
          allowfullscreen
        ></iframe>
      </div>
    </div>
  );
}

export default AboutUs;
